 \"Classifier\", y = \"Accuracy\") +\n","  scale_fill_manual(values = c(\"salmon\", \"lightblue\"),\n","                    labels = c(\"Training Set\", \"Test Set\")) +\n","  theme_minimal() +\n","  theme(axis.text.x = element_text(angle = 45, hjust = 1),\n","        axis.text.y = element_text(size = 8))"]},{"cell_type":"markdown","id":"7e5fe7f3","metadata":{"papermill":{"duration":0.046514,"end_time":"2024-02-27T03:39:43.715888","exception":false,"start_time":"2024-02-27T03:39:43.669374","status":"completed"},"tags":[]},"source":["<div style=\"color:white;\n","           display:fill;\n","           border-radius:5px;\n","           background-color:#ff8c69;\n","           font-size:110%;\n","           font-family:Verdana;\n","           letter-spacing:0.5px;\n","           text-align:center;\n","           margin-top: 10px;\n","           margin-bottom: 10px;\">\n","  <h2 id=\"conclusion\" style=\"text-align:center; padding: 10px;\n","            color:white;\n","            margin: 0;\">\n","      8. CONCLUSION\n","  </h2>\n","</div>"]},{"cell_type":"markdown","id":"ef629228","metadata":{"papermill":{"duration":0.03868,"end_time":"2024-02-27T03:39:43.797281","exception":false,"start_time":"2024-02-27T03:39:43.758601","status":"completed"},"tags":[]},"source":["**Key Features**\n","* The variable with the highest positive correlation with the target variable (class) is size_uniformity (0.8207), followed by shape_uniformity (0.8207) and bare_nucleoli (0.8205). These variables have a strong positive relationship with the class variable, indicating that higher values of these variables are associated with a higher likelihood of the tumor being malignant.\n","\n","* The variable with the highest negative correlation with the target variable (class) is mitoses (-0.4244). This negative correlation suggests that higher values of mitoses are associated with a higher likelihood of the tumor being benign.\n","\n","* Other variables such as clump_thickness, marginal_adhesion, epithelial_size, bland_chromatin, and normal_nucleoli also show moderate positive correlations with the target variable, indicating their influence on the tumor's class.\n","\n","**Optimal algorithm**\n","* Highest accuracy is achieved by Logistic Regression, Random Forest with 96.30% followed by Decision Tree 93.30%"]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":180,"sourceId":408,"sourceType":"datasetVersion"},{"datasetId":1070,"sourceId":1928,"sourceType":"datasetVersion"},{"datasetId":3681,"sourceId":5854,"sourceType":"datasetVersion"},{"datasetId":6043,"sourceId":8927,"sourceType":"datasetVersion"},{"datasetId":8952,"sourceId":12464,"sourceType":"datasetVersion"},{"datasetId":32186,"sourceId":41786,"sourceType":"datasetVersion"},{"datasetId":558169,"sourceId":1015398,"sourceType":"datasetVersion"},{"datasetId":563570,"sourceId":1085908,"sourceType":"datasetVersion"},{"datasetId":788199,"sourceId":1354541,"sourceType":"datasetVersion"},{"datasetId":928475,"sourceId":1571000,"sourceType":"datasetVersion"},{"datasetId":1099851,"sourceId":1849228,"sourceType":"datasetVersion"},{"datasetId":2421032,"sourceId":4092342,"sourceType":"datasetVersion"},{"datasetId":2795253,"sourceId":4825123,"sourceType":"datasetVersion"},{"datasetId":3248517,"sourceId":5651459,"sourceType":"datasetVersion"},{"sourceId":142411483,"sourceType":"kernelVersion"}],"dockerImageVersionId":30530,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":19.400455,"end_time":"2024-02-27T03:39:43.959493","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-02-27T03:39:24.559038","version":"2.4.0"}},"